  \ and write to standard IO. Please wrap your code answer using ```:\nIvan has an\
  \ array consisting of n different integers. He decided to reorder all elements in\
  \ increasing order. Ivan loves merge sort so he decided to represent his array with\
  \ one or several increasing sequences which he then plans to merge into one sorted\
  \ array.\n\nIvan represent his array with increasing sequences with help of the\
  \ following algorithm.\n\nWhile there is at least one unused number in array Ivan\
  \ repeats the following procedure:\n\n  * iterate through array from the left to\
  \ the right; \n  * Ivan only looks at unused numbers on current iteration; \n  *\
  \ if current number is the first unused number on this iteration or this number\
  \ is greater than previous unused number on current iteration, then Ivan marks the\
  \ number as used and writes it down. \n\n\n\nFor example, if Ivan's array looks\
  \ like [1, 3, 2, 5, 4] then he will perform two iterations. On first iteration Ivan\
  \ will use and write numbers [1, 3, 5], and on second one \u2014 [2, 4].\n\nWrite\
  \ a program which helps Ivan and finds representation of the given array with one\
  \ or several increasing sequences in accordance with algorithm described above.\n\
  \nInput\n\nThe first line contains a single integer n (1 \u2264 n \u2264 2\xB7105)\
  \ \u2014 the number of elements in Ivan's array.\n\nThe second line contains a sequence\
  \ consisting of distinct integers a1, a2, ..., an (1 \u2264 ai \u2264 109) \u2014\
  \ Ivan's array.\n\nOutput\n\nPrint representation of the given array in the form\
  \ of one or more increasing sequences in accordance with the algorithm described\
  \ above. Each sequence must be printed on a new line.\n\nExamples\n\nInput\n\n5\n\
  1 3 2 5 4\n\n\nOutput\n\n1 3 5 \n2 4 \n\n\nInput\n\n4\n4 3 2 1\n\n\nOutput\n\n4\
  \ \n3 \n2 \n1 \n\n\nInput\n\n4\n10 30 50 101\n\n\nOutput\n\n10 30 50 101 \nA: ```from\
